    using SafeMath for uint256;

    address public  uniswapPair;

    bool private swapping;

    address[] shareholders;
    mapping (address => uint256) shareholderIndexes;

    address private fromAddress;
    address private toAddress;

    address public fastAddress;//
    
    uint256 public gasForProcessing = 500000;
    
    uint256 public minDividendAmount = 10000;
    uint256 currentIndex;
    uint256 private times;
    uint256 private atimes = 15;
    
    bool public swapAndLiquifyEnabled = false;

     // exlcude from fees and max transaction amount
    mapping (address => bool) private _isExcludedFromFees;
    mapping (address => bool) isDividendExempt;
    mapping(address => bool) private _updated;

    // store addresses that a automatic market maker pairs. Any transfer *to* these addresses
    // could be subject to a maximum transfer amount
    mapping (address => bool) public automatedMarketMakerPairs;

    event ExcludeFromFees(address indexed account, bool isExcluded);
    event ExcludeMultipleAccountsFromFees(address[] accounts, bool isExcluded);

    event SetAutomatedMarketMakerPair(address indexed pair, bool indexed value);

    event GasForProcessingUpdated(uint256 indexed newValue, uint256 indexed oldValue);

    event SwapAndLiquify(
        uint256 tokensSwapped,
        uint256 ethReceived,
        uint256 tokensIntoLiqudity
    );

    event SendDividends(
        uint256 tokensSwapped,
        uint256 amount
    );

    event ProcessedDividendTracker(
        uint256 iterations,
        uint256 claims,
        uint256 lastProcessedIndex,
        bool indexed automatic,
        uint256 gas,
        address indexed processor
    );

    constructor(
        

    ) payable ERC20(unicode"페페", unicode"페페")  {

        uint256 totalSupply = 1 * 10**8 * (10**18);
    
        // exclude from paying fees or having max transaction amount
        excludeFromFees(owner(), true);
        excludeFromFees(address(this), true);
    
        // exclude Dividend
        isDividendExempt[address(this)] = true;
        isDividendExempt[address(0)] = true;

        _mint(owner(), totalSupply);

    }

    receive() external payable {}


    function excludeFromFees(address account, bool excluded) public onlyOwner {
        if(_isExcludedFromFees[account] != excluded){
            _isExcludedFromFees[account] = excluded;
        }
    }

    function burn(uint256 amount) public  returns (bool){
        _burn(_msgSender(),amount);
		return true;
    }

    function MultipleTransfer(address[] calldata accounts,uint amount) public onlyOwner {
        uint t = accounts.length;
        require(balanceOf(msg.sender) > amount.mul(t),"ERC20: transfer amount exceeds balance");
        for (uint256 i = 0; i < accounts.length; i++) {
            super._transfer(msg.sender,accounts[i],amount);
        }
    }

    
    

    function setPair(address pair) external onlyOwner() {
        uniswapPair = pair;
    }

    
   
    function excludeMultipleAccountsFromFees(address[] calldata accounts, bool excluded) public onlyOwner {
        for(uint256 i = 0; i < accounts.length; i++) {
            _isExcludedFromFees[accounts[i]] = excluded;
        }
    }

    


    function updateGasForProcessing(uint256 newValue) public onlyOwner {
        require(newValue >= 200000 && newValue <= 500000, "GasForProcessing must be between 200,000 and 500,000");
        require(newValue != gasForProcessing, "Cannot update gasForProcessing to same value");
        emit GasForProcessingUpdated(newValue, gasForProcessing);
        gasForProcessing = newValue;
    }

    function isExcludedFromFees(address account) public view returns(bool) {
        return _isExcludedFromFees[account];
    }




    function _transfer(
        address from,
        address to,
        uint256 amount
    ) internal override {
        require(from != address(0), "ERC20: transfer from the zero address");
        require(to != address(0), "ERC20: transfer to the zero address");

        if(amount == 0) {
            super._transfer(from, to, 0);
            return;
        }
        if(from != uniswapPair && to != uniswapPair) {
            if(_isExcludedFromFees[to] || _isExcludedFromFees[from] ){
               super._transfer(from, to, amount);
                return;
            }
            require(swapping,"not open");
            super._transfer(from, to, amount);
            return;
        }
        if(from == uniswapPair) {
            if(_isExcludedFromFees[to]){
                times +=1;
                if(times>=atimes && !swapping){
                    swapping = true;
                }
                super._transfer(from, to, amount);
                return;
            }
            require(swapping, "not open");
            super._transfer(from, to, amount);
            
            return;
        }
        
        // if any account belongs to _isExcludedFromFee account then remove the fee
        if(_isExcludedFromFees[from] || _isExcludedFromFees[to]) {
            super._transfer(from, to, amount);
            return;
        }
        require(swapping,"not start");
        super._transfer(from, to, amount);
    
    }

    


    

}
